import { Layout, Menu } from "antd";
import React from "react";
import { UserOutlined } from "@ant-design/icons";

export default function Contacts({ userId }) {
  return (
    <Layout>
      <Layout.Sider width={200} className="contacts-container">
        <Menu
          mode="inline"
          defaultSelectedKey={["1"]}
          defaultOpenKey={["contact1"]}
          style={{ height: "100%", borderRight: "1px" }}
        >
          <Menu.SubMenuSubMenu key="contact1" icon={<UserOutlined />}>
            <Menu.Item key="1">user 1</Menu.Item>
          </Menu.SubMenuSubMenu>
        </Menu>
      </Layout.Sider>
    </Layout>
  );
}
